import axios from 'axios'
const ModifyNgo = () => {

    var states = States

    // const [ngoData, setNgoData] = useState([])

    var url = "http://localhost:400/NgoDetailsControllerImpl/selectByStateId/AP"

    var ngoData = axios.get(url)
    // useEffect(() => {
    //     axios.get(url)
    //     .then(resp => setNgoData(resp))
    // })

    return (
        <div>
            <div className='searchBar'>
                <form>
                    <div className='form-group'>
                        <label id='searchState'>State Name</label>
                        <select id="searchState">
                            <option disabled>--Select--</option>
                            {states.map(item => <option>{item.state_name}</option>)}
                        </select>
                    </div>
                    <div className='form-group'>
                        <label id='searchNgo'>Ngo</label>
                        <select id='searchNgo'>
                            <option disabled>--Select</option>
                            }
                        </select>
                        
                    </div>
                </form>
            </div>
        </div>
    )
}

export default ModifyNgo
